import React from 'react';
import Link from 'next/link'


const fakeData = [
  {
    id: 1,
    name: "ມັງພຸດ",
    description: "ຜົນລະໄມ້ສົດຈາກສ່ວນ",
    price: 105,
    imageUrl:'https://unsplash.com/photos/MardkT836BU'
  },
  {
    id: 2,
    name: "ລຳໄຍ",
    description: "ຜົນລະໄມ້ສົດຈາກສ່ວນ",
    price: 125,
    imageUrl:'https://unsplash.com/photos/MardkT836BU'
  },
  {
    id: 3,
    name: "ທຸເລືອນ",
    description: "ຜົນລະໄມ້ທີກູຍັງງົງຄົນກິນມັນໄດ້ແນວໃດ",
    price: 135,
    imageUrl:'https://unsplash.com/photos/MardkT836BU'
  }
]
function products() {
  return (
    <div>
      {fakeData.map(prod => 
          <Link key={prod.id} href='/products/product_detail' as={`/products/${prod.id}`}>
            <a>
              <div>{prod.name}</div>
            </a>
          </Link>    
      )}
    </div>
  )
}

export default products
